		{ id:2, text:'얼음'},
		{ id:3, text:'눈'},
		{ id:4, text:'바람'},
	]);
	const [inputText, setInputText] = useState('');
	const [nextId, setNextId] = useState(5);

	const onChange = e => setInputText(e.target.value);

	const nameList = names.map(name => <li key={name.id}>{name.text}</li>);
